import  {SHOW_NUMBER}  from  "./actionTypes"
const  defaultState={
     numberConcat:""
}
export  default(state=defaultState,action)=>{
     // eslint-disable-next-line 
        switch(action.type){
          case SHOW_NUMBER: 
             let  newState=JSON.parse(JSON.stringify(state))
             newState.numberConcat+=action.show
             return  newState




            }
    return  state
}
